    <>
      <div className="main_Nav">
        <Navbar />
      </div>
     <section id='cart' className="section=p1">
     <table>
     <thead>
     <tr>
     <td>Remove</td>
     <td>Image</td>
     <td>Product</td>
     <td>Price</td>
     <td>Q</td>

